import React, { useState } from "react";
import Layout from "../../components/Layout/Layout";
import TableFournisseur from "../../components/TableFournisseur/TableFournisseur";

function Dashbord() {
  const [showTable, setShowTable] = useState(false);

  const handleFournisseurClick = () => {
    setShowTable(true);
  };

  return (
    <div>
      <Layout>
        <div className="flex flex-col justify-center items-center text-xl gap-5 my-20">
          <li>
            <a href="#" onClick={handleFournisseurClick}>
              fournisseur
            </a>
          </li>
          <li>
            <a href="#">ressource</a>
          </li>
          <li>
            <a href="#">materiaux</a>
          </li>
        </div>
      </Layout>

      {showTable && <TableFournisseur />}
    </div>
  );
}

export default Dashbord;
